create table user_expense_changes
(
    id                        int unsigned auto_increment
        primary key,
    user_id                   int unsigned                       not null comment '用户ID',
    personal_expense_in_cents bigint                             not null comment '用户个人消费金额',
    team_expense_in_cents     bigint                             not null comment '用户团队（下级被邀请注册用户）消费金额，不含用户个人消费金额',
    type                      tinyint unsigned                   not null comment '变更类型，0：购买商品、1：退款',
    created_at                datetime default CURRENT_TIMESTAMP not null,
    updated_at                datetime                           null,
    deleted_at                datetime                           null
)
    collate = utf8mb4_unicode_ci;

create index user_expense_changes_created_at_index
    on user_expense_changes (created_at);

create index user_expense_changes_user_id_index
    on user_expense_changes (user_id);

